import {loadJokes} from '../Graphqlservices/requests';

 const loadJoke= async (state='JustTestt',action)=>
{
    switch (action.type) {
        case 'LOADJOKE':
                return state='Got it'
                
            break;
    
        default:
           return state;
    }
}
export default loadJoke;
